INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12, "", 71, "アヤネ", 0, 0, 2, 80001, 0, 0, 102301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, "", 72, "チカ", 0, 0, 1, 80001, 0, 1, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 12, "", 73, "チカ", 0, 0, 2, 80001, 0, 1, 104201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, "", 74, "クルミ", 0, 0, 1, 80001, 0, 2, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, "", 75, "クルミ", 0, 0, 2, 80001, 0, 2, 102101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, "", 76, "シズル", 0, 0, 1, 80001, 0, 0, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, "", 77, "シズル", 0, 0, 2, 80001, 0, 0, 104901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, "", 78, "リノ", 0, 0, 1, 80001, 0, 1, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, "", 79, "リノ", 0, 0, 2, 80001, 0, 1, 101101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, "", 80, "ユイ", 0, 0, 1, 80001, 0, 0, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, "", 81, "ユイ", 0, 0, 2, 80001, 0, 0, 100201);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, "", 82, "ヒヨリ", 0, 0, 1, 80001, 0, 1, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, "", 83, "ヒヨリ", 0, 0, 2, 80001, 0, 1, 100101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, "", 84, "レイ", 0, 0, 1, 80001, 0, 2, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キミに背中を預けられる日が、\n早くきますように", 14, "", 85, "レイ", 0, 0, 2, 80001, 0, 2, 100301);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, "", 86, "ペコリーヌ", 0, 0, 1, 80001, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("これからもずっと、覚えていて\nくださいね！", 15, "", 87, "ペコリーヌ", 0, 0, 2, 80001, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, "", 88, "コッコロ", 0, 0, 1, 80001, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, "", 89, "コッコロ", 0, 0, 2, 80001, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, "", 90, "キャル", 0, 0, 1, 80001, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, "", 91, "キャル", 0, 0, 2, 80001, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, "", 92, "スズメ", 0, 1, 1, 60001, 0, 1, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, "", 93, "", 1, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, "", 94, "", 1, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, "", 95, "", 1, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, "", 96, "", 1, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, "", 97, "", 1, 2, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, "", 98, "", 2, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, "", 99, "", 2, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, "", 100, "", 2, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, "", 101, "", 2, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, "", 102, "", 2, 2, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, "", 103, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, "", 104, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, "", 105, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, "", 106, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, "", 107, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, "", 108, "", 3, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, "", 109, "", 3, 2, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, "", 110, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, "", 111, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, "", 112, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, "", 113, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, "", 114, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, "", 115, "", 4, 1, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, "", 116, "", 4, 2, 0, 60001, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, "", 117, "スズメ", 0, 0, 2, 60001, 0, 3, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, "", 118, "スズメ", 0, 0, 3, 60001, 0, 3, 112101);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 1, "", 119, "ペコリーヌ", 0, 0, 1, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, "", 120, "コッコロ", 0, 0, 1, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, "", 121, "コッコロ", 0, 0, 2, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("え？　ちょっと\nいきなりなにっ？", 1, "", 122, "キャル", 0, 0, 1, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, "", 123, "キャル", 0, 0, 2, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, "", 124, "ペコリーヌ", 0, 0, 2, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, "", 125, "ペコリーヌ", 0, 0, 3, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 1, "", 126, "コッコロ", 0, 0, 3, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, "", 127, "キャル", 0, 0, 3, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, "", 128, "コッコロ", 0, 0, 4, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, "", 129, "ペコリーヌ", 0, 0, 4, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, "", 130, "キャル", 0, 0, 4, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, "", 131, "コッコロ", 0, 0, 5, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, "", 132, "キャル", 0, 0, 5, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, "", 133, "カリン", 0, 0, 1, 80003, 0, 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 2, "", 134, "キャル", 0, 0, 6, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, "", 135, "カリン", 0, 0, 2, 80003, 0, 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, "", 136, "キャル", 0, 0, 7, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, "", 137, "カリン", 0, 0, 3, 80003, 0, 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, "", 138, "キャル", 0, 0, 8, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, "", 139, "キャル", 0, 0, 9, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, "", 140, "カリン", 0, 0, 4, 80003, 0, 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, "", 141, "キャル", 0, 0, 10, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, "", 142, "カリン", 0, 0, 5, 80003, 0, 1, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, "", 143, "キャル", 0, 0, 11, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, "", 144, "コッコロ", 0, 0, 6, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, "", 145, "ペコリーヌ", 0, 0, 5, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, "", 146, "コッコロ", 0, 0, 7, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, "", 147, "コッコロ", 0, 0, 8, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, "", 148, "ペコリーヌ", 0, 0, 6, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, "", 149, "ペコリーヌ", 0, 0, 7, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 3, "", 150, "コッコロ", 0, 0, 9, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, "", 151, "ペコリーヌ", 0, 0, 8, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, "", 152, "コッコロ", 0, 0, 10, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 3, "", 153, "ペコリーヌ", 0, 0, 9, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, "", 154, "コッコロ", 0, 0, 11, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, "", 155, "ペコリーヌ", 0, 0, 10, 80003, 0, 1, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, "", 156, "ペコリーヌ", 0, 0, 11, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, "", 157, "キャル", 0, 0, 12, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, "", 158, "ペコリーヌ", 0, 0, 12, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, "", 159, "キャル", 0, 0, 13, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, "", 160, "ペコリーヌ", 0, 0, 13, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…積極的？\nなんの話よ？", 4, "", 161, "キャル", 0, 0, 14, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, "", 162, "ペコリーヌ", 0, 0, 14, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 4, "", 163, "ペコリーヌ", 0, 0, 15, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, "", 164, "キャル", 0, 0, 15, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, "", 165, "ペコリーヌ", 0, 0, 16, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, "", 166, "キャル", 0, 0, 16, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, "", 167, "キャル", 0, 0, 17, 80003, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, "", 168, "キャル", 0, 0, 18, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, "", 169, "コッコロ", 0, 0, 12, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, "", 170, "キャル", 0, 0, 19, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, "", 171, "コッコロ", 0, 0, 13, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, "", 172, "キャル", 0, 0, 20, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, "", 173, "コッコロ", 0, 0, 14, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, "", 174, "キャル", 0, 0, 21, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, "", 175, "コッコロ", 0, 0, 15, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("かくし芸？", 5, "", 176, "キャル", 0, 0, 22, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, "", 177, "コッコロ", 0, 0, 16, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, "", 178, "キャル", 0, 0, 23, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, "", 179, "ペコリーヌ", 0, 0, 17, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, "", 180, "キャル", 0, 0, 24, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, "", 181, "コッコロ", 0, 0, 17, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, "", 182, "ペコリーヌ", 0, 0, 18, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, "", 183, "キャル", 0, 0, 25, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, "", 184, "コッコロ", 0, 0, 18, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, "", 185, "キャル", 0, 0, 26, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, "", 186, "キャル", 0, 0, 27, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, "", 187, "キャル", 0, 0, 28, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, "", 188, "ペコリーヌ", 0, 0, 19, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, "", 189, "コッコロ", 0, 0, 19, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, "", 190, "キャル", 0, 0, 29, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, "", 191, "キャル", 0, 0, 30, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, "", 192, "キャル", 0, 0, 31, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, "", 193, "キャル", 0, 0, 32, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 7, "", 194, "キャル", 0, 0, 33, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, "", 195, "キャル", 0, 0, 34, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆", 7, "", 196, "キャル", 0, 0, 35, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, "", 197, "キャル", 0, 0, 36, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, "", 198, "キャル", 0, 0, 37, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, "", 199, "キャル", 0, 0, 38, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, "", 200, "コッコロ", 0, 0, 20, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, "", 201, "コッコロ", 0, 0, 21, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, "", 202, "コッコロ", 0, 0, 22, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, "", 203, "コッコロ", 0, 0, 23, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, "", 204, "コッコロ", 0, 0, 24, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆", 8, "", 205, "コッコロ", 0, 0, 25, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, "", 206, "コッコロ", 0, 0, 26, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, "", 207, "コッコロ", 0, 0, 27, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, "", 208, "コッコロ", 0, 0, 28, 80003, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆", 9, "", 209, "ペコリーヌ", 0, 0, 20, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, "", 210, "ペコリーヌ", 0, 0, 21, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あと６日で2.5周年ですか…", 9, "", 211, "ペコリーヌ", 0, 0, 22, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, "", 212, "ペコリーヌ", 0, 0, 23, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, "", 213, "ペコリーヌ", 0, 0, 24, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆", 9, "", 214, "ペコリーヌ", 0, 0, 25, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, "", 215, "ペコリーヌ", 0, 0, 26, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, "", 216, "ペコリーヌ", 0, 0, 27, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, "", 217, "ペコリーヌ", 0, 0, 28, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, "", 218, "ペコリーヌ", 0, 0, 29, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, "", 219, "ペコリーヌ", 0, 0, 30, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, "", 220, "ペコリーヌ", 0, 0, 31, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, "", 221, "コッコロ", 0, 0, 29, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, "", 222, "ペコリーヌ", 0, 0, 32, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…………", 10, "", 223, "キャル", 0, 0, 39, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, "", 224, "コッコロ", 0, 0, 30, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, "", 225, "キャル", 0, 0, 40, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, "", 226, "ペコリーヌ", 0, 0, 33, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, "", 227, "キャル", 0, 0, 41, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, "", 228, "ペコリーヌ", 0, 0, 34, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, "", 229, "ペコリーヌ", 0, 0, 35, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, "", 230, "キャル", 0, 0, 42, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, "", 231, "コッコロ", 0, 0, 31, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, "", 232, "キャル", 0, 0, 43, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, "", 233, "ペコリーヌ", 0, 0, 36, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, "", 234, "カリン", 0, 0, 6, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, "", 235, "カリン", 0, 0, 7, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, "", 236, "カリン", 0, 0, 8, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, "", 237, "カリン", 0, 0, 9, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, "", 238, "カリン", 0, 0, 10, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 11, "", 239, "カリン", 0, 0, 11, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, "", 240, "カリン", 0, 0, 12, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, "", 241, "カリン", 0, 0, 13, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あれ？\nもしかして緊張で気を失って…？", 11, "", 242, "カリン", 0, 0, 14, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, "", 243, "カリン", 0, 0, 15, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, "", 244, "カリン", 0, 0, 16, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それでは\nまた明日お会いしましょう♪", 11, "", 245, "カリン", 0, 0, 17, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, "", 246, "キャル", 0, 0, 44, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, "", 247, "ペコリーヌ", 0, 0, 37, 80003, 0, 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, "", 248, "コッコロ", 0, 0, 32, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, "", 249, "キャル", 0, 0, 45, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ひどいですよぉキャルちゃ～ん！", 12, "", 250, "ペコリーヌ", 0, 0, 38, 80003, 0, 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, "", 251, "コッコロ", 0, 0, 33, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, "", 252, "ペコリーヌ", 0, 0, 39, 80003, 0, 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, "", 253, "キャル", 0, 0, 46, 80003, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, "", 254, "コッコロ", 0, 0, 34, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, "", 255, "ペコリーヌ", 0, 0, 40, 80003, 0, 2, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, "", 256, "ペコリーヌ", 0, 0, 41, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, "", 257, "キャル", 0, 0, 47, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("忘れてきちゃいました☆", 13, "", 258, "ペコリーヌ", 0, 0, 42, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, "", 259, "キャル", 0, 0, 48, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, "", 260, "コッコロ", 0, 0, 35, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, "", 261, "キャル", 0, 0, 49, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, "", 262, "ペコリーヌ", 0, 0, 43, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, "", 263, "キャル", 0, 0, 50, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, "", 264, "コッコロ", 0, 0, 36, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, "", 265, "キャル", 0, 0, 51, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, "", 266, "コッコロ", 0, 0, 37, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, "", 267, "キャル", 0, 0, 52, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, "", 268, "ペコリーヌ", 0, 0, 44, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, "", 269, "コッコロ", 0, 0, 38, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, "", 270, "ペコリーヌ", 0, 0, 45, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, "", 271, "キャル", 0, 0, 53, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, "", 272, "ペコリーヌ", 0, 0, 46, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 14, "", 273, "カリン", 0, 0, 18, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 14, "", 274, "カリン", 0, 0, 19, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, "", 275, "カリン", 0, 0, 20, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, "", 276, "カリン", 0, 0, 21, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, "", 277, "カリン", 0, 0, 22, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, "", 278, "カリン", 0, 0, 23, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, "", 279, "カリン", 0, 0, 24, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, "", 280, "カリン", 0, 0, 25, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, "", 281, "カリン", 0, 0, 26, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, "", 282, "カリン", 0, 0, 27, 80003, 0, 0, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("準備はいいですかっ？\n…いっきますよー！", 15, "", 283, "ペコリーヌ", 0, 0, 47, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("祝！", 15, "", 284, "キャル", 0, 0, 54, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年！", 15, "", 285, "コッコロ", 0, 0, 39, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おめでとうございま～す☆", 15, "", 286, "ペコリーヌ", 0, 0, 48, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, "", 287, "キャル", 0, 0, 55, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, "", 288, "コッコロ", 0, 0, 40, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, "", 289, "ペコリーヌ", 0, 0, 49, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, "", 290, "キャル", 0, 0, 56, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, "", 291, "コッコロ", 0, 0, 41, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, "", 292, "キャル", 0, 0, 57, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, "", 293, "ペコリーヌ", 0, 0, 50, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, "", 294, "キャル", 0, 0, 58, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 15, "", 295, "ペコリーヌ", 0, 0, 51, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("意味分かんないわよ！", 15, "", 296, "キャル", 0, 0, 59, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, "", 297, "コッコロ", 0, 0, 42, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, "", 298, "コッコロ", 0, 0, 43, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, "", 299, "ペコリーヌ", 0, 0, 52, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, "", 300, "キャル", 0, 0, 60, 80003, 0, 2, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, "", 301, "コッコロ", 0, 0, 44, 80003, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, "", 302, "ペコリーヌ", 0, 0, 53, 80003, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("2.5周年\nありがとうございます！", 15, "105901,45,106001,61", 303, "ペコリーヌ・コッコロ・キャル", 0, 0, 54, 80003, 1, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 304, "カリン", 0, 1, 1, 60002, 0, 1, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, "", 305, "", 1, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, "", 306, "", 1, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, "", 307, "", 1, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, "", 308, "", 1, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, "", 309, "", 1, 2, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, "", 310, "", 2, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, "", 311, "", 2, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, "", 312, "", 2, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, "", 313, "", 2, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, "", 314, "", 2, 2, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, "", 315, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, "", 316, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, "", 317, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, "", 318, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, "", 319, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, "", 320, "", 3, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, "", 321, "", 3, 2, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, "", 322, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, "", 323, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, "", 324, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, "", 325, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, "", 326, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, "", 327, "", 4, 1, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, "", 328, "", 4, 2, 0, 60002, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 329, "カリン", 0, 0, 2, 60002, 0, 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, "", 330, "カリン", 0, 0, 3, 60002, 0, 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ささ、シェフィさまはこちらへ…", 1, "", 331, "コッコロ", 0, 0, 1, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 1, "", 332, "シェフィ", 0, 0, 1, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, "", 333, "ペコリーヌ", 0, 0, 1, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, "", 334, "コッコロ", 0, 0, 2, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええと…\n二人とも何をしているの？", 1, "", 335, "シェフィ", 0, 0, 2, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, "", 336, "キャル", 0, 0, 1, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あの日…？", 1, "", 337, "シェフィ", 0, 0, 3, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, "", 338, "ペコリーヌ", 0, 0, 2, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, "", 339, "ペコリーヌ", 0, 0, 3, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("やばいですね☆", 1, "", 340, "カリン", 0, 0, 1, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("って、なにしれっと\n参加してんのよカリン！", 1, "", 341, "キャル", 0, 0, 2, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, "", 342, "カリン", 0, 0, 2, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, "", 343, "カリン", 0, 0, 3, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, "", 344, "ペコリーヌ", 0, 0, 4, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 1, "", 345, "シェフィ", 0, 0, 4, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, "", 346, "ペコリーヌ", 0, 0, 5, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, "", 347, "コッコロ", 0, 0, 3, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, "", 348, "コッコロ", 0, 0, 4, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, "", 349, "ペコリーヌ", 0, 0, 6, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さすがでございます\nペコリーヌさま", 2, "", 350, "コッコロ", 0, 0, 5, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, "", 351, "キャル", 0, 0, 3, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 2, "", 352, "シェフィ", 0, 0, 5, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, "", 353, "ペコリーヌ", 0, 0, 7, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さ、次はキャルさまの\n番でございますよ", 2, "", 354, "コッコロ", 0, 0, 6, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, "", 355, "キャル", 0, 0, 4, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, "", 356, "シェフィ", 0, 0, 6, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, "", 357, "キャル", 0, 0, 5, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, "", 358, "キャル", 0, 0, 6, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, "", 359, "コッコロ", 0, 0, 7, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, "", 360, "キャル", 0, 0, 7, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, "", 361, "コッコロ", 0, 0, 8, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, "", 362, "ペコリーヌ", 0, 0, 8, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, "", 363, "コッコロ", 0, 0, 9, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("聖学祭…って、なにかしら？", 3, "", 364, "シェフィ", 0, 0, 7, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, "", 365, "コッコロ", 0, 0, 10, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, "", 366, "キャル", 0, 0, 8, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, "", 367, "キャル", 0, 0, 9, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, "", 368, "ペコリーヌ", 0, 0, 9, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いや、そのまんますぎでしょ…", 3, "", 369, "キャル", 0, 0, 10, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, "", 370, "シェフィ", 0, 0, 8, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, "", 371, "ペコリーヌ", 0, 0, 10, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっ？　ええ…\nぎゅーっ…？", 3, "", 372, "シェフィ", 0, 0, 9, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, "", 373, "キャル", 0, 0, 11, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, "", 374, "シェフィ", 0, 0, 10, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, "", 375, "キャル", 0, 0, 12, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, "", 376, "コッコロ", 0, 0, 11, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, "", 377, "キャル", 0, 0, 13, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, "", 378, "ペコリーヌ", 0, 0, 11, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, "", 379, "キャル", 0, 0, 14, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, "", 380, "キャル", 0, 0, 15, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, "", 381, "シェフィ", 0, 0, 11, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, "", 382, "ペコリーヌ", 0, 0, 12, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, "", 383, "コッコロ", 0, 0, 12, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, "", 384, "キャル", 0, 0, 16, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, "", 385, "シェフィ", 0, 0, 12, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, "", 386, "ペコリーヌ", 0, 0, 13, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, "", 387, "ペコリーヌ", 0, 0, 14, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, "", 388, "ペコリーヌ", 0, 0, 15, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, "", 389, "キャル", 0, 0, 17, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, "", 390, "キャル", 0, 0, 18, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, "", 391, "シェフィ", 0, 0, 13, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, "", 392, "コッコロ", 0, 0, 13, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, "", 393, "ペコリーヌ", 0, 0, 16, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, "", 394, "キャル", 0, 0, 19, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, "", 395, "ペコリーヌ", 0, 0, 17, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, "", 396, "ペコリーヌ", 0, 0, 18, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, "", 397, "ペコリーヌ", 0, 0, 19, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, "", 398, "カリン", 0, 0, 4, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, "", 399, "カリン", 0, 0, 5, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…えっ！？", 6, "", 400, "キャル", 0, 0, 20, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, "", 401, "ペコリーヌ", 0, 0, 20, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, "", 402, "シェフィ", 0, 0, 14, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, "", 403, "コッコロ", 0, 0, 14, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, "", 404, "シェフィ", 0, 0, 15, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, "", 405, "キャル", 0, 0, 21, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, "", 406, "ペコリーヌ", 0, 0, 21, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ぶっ殺すぞ！？", 6, "", 407, "キャル", 0, 0, 22, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, "", 408, "カリン", 0, 0, 6, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, "", 409, "コッコロ", 0, 0, 15, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, "", 410, "キャル", 0, 0, 23, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, "", 411, "シェフィ", 0, 0, 16, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, "", 412, "ペコリーヌ", 0, 0, 22, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, "", 413, "キャル", 0, 0, 24, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, "", 414, "シェフィ", 0, 0, 17, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, "", 415, "コッコロ", 0, 0, 16, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, "", 416, "シェフィ", 0, 0, 18, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 7, "", 417, "コッコロ", 0, 0, 17, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("しれっと教育ママが\n生まれてる…？", 7, "", 418, "キャル", 0, 0, 25, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, "", 419, "ペコリーヌ", 0, 0, 23, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("え～～～～！？", 7, "", 420, "キャル", 0, 0, 26, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, "", 421, "キャル", 0, 0, 27, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, "", 422, "シェフィ", 0, 0, 19, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, "", 423, "コッコロ", 0, 0, 18, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, "", 424, "ペコリーヌ", 0, 0, 24, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, "", 425, "シェフィ", 0, 0, 20, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, "", 426, "キャル", 0, 0, 28, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, "", 427, "コッコロ", 0, 0, 19, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, "", 428, "シェフィ", 0, 0, 21, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, "", 429, "キャル", 0, 0, 29, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, "", 430, "キャル", 0, 0, 30, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, "", 431, "ペコリーヌ", 0, 0, 25, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, "", 432, "キャル", 0, 0, 31, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, "", 433, "シェフィ", 0, 0, 22, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 9, "", 434, "シェフィ", 0, 0, 23, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, "", 435, "シェフィ", 0, 0, 24, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, "", 436, "シェフィ", 0, 0, 25, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, "", 437, "シェフィ", 0, 0, 26, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 9, "", 438, "シェフィ", 0, 0, 27, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("―びえぇぇ～んっ！！！", 9, "", 439, "シェフィ", 0, 0, 28, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("どうされましたか、シェフィさま", 9, "", 440, "コッコロ", 0, 0, 20, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ううっ…ひっく…\nママッ…！", 9, "", 441, "シェフィ", 0, 0, 29, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, "", 442, "コッコロ", 0, 0, 21, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, "", 443, "コッコロ", 0, 0, 22, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, "", 444, "シェフィ", 0, 0, 30, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("主さま\n3.5周年まであと５日\nでございます", 10, "", 445, "コッコロ", 0, 0, 23, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですがその前に\n生放送がありますね", 10, "", 446, "コッコロ", 0, 0, 24, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…生放送に向けた\n意気込みでございますか？", 10, "", 447, "コッコロ", 0, 0, 25, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, "", 448, "コッコロ", 0, 0, 26, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, "", 449, "コッコロ", 0, 0, 27, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, "", 450, "コッコロ", 0, 0, 28, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, "", 451, "コッコロ", 0, 0, 29, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, "", 452, "コッコロ", 0, 0, 30, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, "", 453, "コッコロ", 0, 0, 31, 80005, 0, 0, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと４日！\nやばいですね☆", 11, "", 454, "ペコリーヌ", 0, 0, 26, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, "", 455, "キャル", 0, 0, 32, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, "", 456, "ペコリーヌ", 0, 0, 27, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, "", 457, "ペコリーヌ", 0, 0, 28, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, "", 458, "ペコリーヌ", 0, 0, 29, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, "", 459, "キャル", 0, 0, 33, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, "", 460, "ペコリーヌ", 0, 0, 30, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, "", 461, "ペコリーヌ", 0, 0, 31, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, "", 462, "ペコリーヌ", 0, 0, 32, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("だからあたしはやるなんて一言も…", 11, "", 463, "キャル", 0, 0, 34, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("オイッスー☆", 11, "", 464, "ペコリーヌ", 0, 0, 33, 80005, 0, 0, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("聞きなさいっての！！", 11, "", 465, "キャル", 0, 0, 35, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 12, "", 466, "シェフィ", 0, 0, 31, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, "", 467, "シェフィ", 0, 0, 32, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 12, "", 468, "シェフィ", 0, 0, 33, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, "", 469, "シェフィ", 0, 0, 34, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, "", 470, "シェフィ", 0, 0, 35, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("やってますねシェフィちゃん！", 12, "", 471, "ペコリーヌ", 0, 0, 34, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なによ、考えることは\nみんな同じってこと？", 12, "", 472, "キャル", 0, 0, 36, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, "", 473, "コッコロ", 0, 0, 32, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("みんな…もちろんよ！", 12, "", 474, "シェフィ", 0, 0, 36, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, "", 475, "ペコリーヌ", 0, 0, 35, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, "", 476, "カリン", 0, 0, 7, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, "", 477, "カリン", 0, 0, 8, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, "", 478, "ペコリーヌ", 0, 0, 36, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, "", 479, "カリン", 0, 0, 9, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, "", 480, "コッコロ", 0, 0, 33, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, "", 481, "カリン", 0, 0, 10, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 13, "", 482, "キャル", 0, 0, 37, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, "", 483, "カリン", 0, 0, 11, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あうー？", 13, "", 484, "シェフィ", 0, 0, 37, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("あ…", 13, "105901,34,106001,38,190801,12", 485, "みんな", 0, 0, 37, 80005, 1, 4, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, "", 486, "キャル", 0, 0, 39, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, "", 487, "コッコロ", 0, 0, 35, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, "", 488, "ペコリーヌ", 0, 0, 38, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, "", 489, "カリン", 0, 0, 13, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, "", 490, "シェフィ", 0, 0, 38, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, "", 491, "ペコリーヌ", 0, 0, 39, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, "", 492, "キャル", 0, 0, 40, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, "", 493, "コッコロ", 0, 0, 36, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, "", 494, "シェフィ", 0, 0, 39, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, "", 495, "ペコリーヌ", 0, 0, 40, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, "", 496, "コッコロ", 0, 0, 37, 80005, 0, 1, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, "", 497, "キャル", 0, 0, 41, 80005, 0, 0, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("へ、へぇ…", 14, "", 498, "シェフィ", 0, 0, 40, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, "", 499, "ペコリーヌ", 0, 0, 41, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, "", 500, "シェフィ", 0, 0, 41, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, "", 501, "シェフィ", 0, 0, 42, 80005, 0, 2, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, "", 502, "ペコリーヌ", 0, 0, 42, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("祝！", 15, "", 503, "キャル", 0, 0, 42, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("3.5周年！", 15, "", 504, "コッコロ", 0, 0, 38, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おめでとうございます！", 15, "", 505, "シェフィ", 0, 0, 43, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, "", 506, "カリン", 0, 0, 14, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, "", 507, "カリン", 0, 0, 15, 80005, 0, 2, 190801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, "", 508, "ペコリーヌ", 0, 0, 43, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, "", 509, "ペコリーヌ", 0, 0, 44, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, "", 510, "キャル", 0, 0, 43, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, "", 511, "キャル", 0, 0, 44, 80005, 0, 1, 106001);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, "", 512, "シェフィ", 0, 0, 44, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, "", 513, "シェフィ", 0, 0, 45, 80005, 0, 0, 106401);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, "", 514, "コッコロ", 0, 0, 39, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, "", 515, "コッコロ", 0, 0, 40, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, "", 516, "コッコロ", 0, 0, 41, 80005, 0, 4, 105901);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, "", 517, "ペコリーヌ", 0, 0, 45, 80005, 0, 3, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("これからも\nよろしくおねがいします！", 15, "105901,42,106001,45,106401,46,190801,16", 518, "みんな", 0, 0, 46, 80005, 1, 4, 105801);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 519, "カリン", 0, 1, 1, 60003, 0, 1, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, "", 520, "", 1, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, "", 521, "", 1, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, "", 522, "", 1, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, "", 523, "", 1, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, "", 524, "", 1, 2, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, "", 525, "", 2, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, "", 526, "", 2, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, "", 527, "", 2, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, "", 528, "", 2, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, "", 529, "", 2, 2, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, "", 530, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, "", 531, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, "", 532, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, "", 533, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, "", 534, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, "", 535, "", 3, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, "", 536, "", 3, 2, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, "", 537, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, "", 538, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, "", 539, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, "", 540, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, "", 541, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, "", 542, "", 4, 1, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0, "", 543, "", 4, 2, 0, 60003, 0, 2, 0);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 544, "カリン", 0, 0, 2, 60003, 0, 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, "", 545, "カリン", 0, 0, 3, 60003, 0, 3, 190804);
INSERT INTO `v1_e4490a29ec461af957058cb1092059d9ac57d6c99ed2c998a4a304cd796c6988` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 546, "カリン", 0, 1, 1, 60004, 0, 1, 190804);
